import styled from 'styled-components';
import {FaTimes} from 'react-icons/fa';
import {Link as LinkScroll} from 'react-scroll';
import {Link as LinkRout} from 'react-router-dom';

export const TemaContainer = styled.div`
    background: red;
    display: flex;
    justify-content: center;
    align-items: center;
    height: 950px;
    position: relative;
    z-zIndex: 1;

`;

export const TeamBG = styled.div`
    position: absolute;
    top: 0;
    right: 0;
    bottom: 0;
    left: 0;
    width: 100%;
    height: 100%
    overflow: hidden;
`;

export const VdoBG = styled.video`
    height: 100%;
    width: 100%;
    -o-object-fit: cover;
    object-fit: cover;
    background: black;
`;
